import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import Navbar from '../Navbar';

function SignUp() {
  return (
  <>
  <Navbar />
  <h1 className='sign-up'>COMING SOON</h1>
  <Footer />
  </>
  );
}
export default SignUp;
